import './Home.css';
import { GeneralButton } from '../components/Buttons';


export const TEST = () => {
    return (
        <main>
        <p>TEST POST</p>
<div>
<form action="/Test">
<label>APOLLO</label>
<input type="hidden" name='codename' value='APOLLO'></input>
<GeneralButton type='submit' name='action' value='Details'>POST</GeneralButton>
</form>
</div>
        </main>
      
    );
  };
